package jobs

import (
	"bytes"
	"encoding/json"
	"fmt"
	"io/ioutil"
	"log"
	"mime/multipart"
	"net/http"
)

type SpbExchange struct {
	SymbolChan chan string
}

//RunJob - run spb exchange job
func (sbpExchange SpbExchange) RunJob() {
	go func() {
		sbpExchange.spbExchangeLoadSymbols()
	}()
}

// spbExchangeLoadSymbols - load SPB exchanges foreign symbols
func (sbpExchange SpbExchange) spbExchangeLoadSymbols() {
	symbolPages := spbExchangeInitSymbolPages()

	for x := 0; x < 5; x++ { //5
		for pageIndex := 0; pageIndex < 21; pageIndex++ { //21
			pageIndexStr := fmt.Sprintf("%02d", pageIndex)

			content := spbExchangeLoadSymbol(pageIndexStr, symbolPages[x]["viewState"], symbolPages[x]["eventValidation"])

			out, err := json.Marshal(content)
			if err != nil {
				log.Printf("ERROR: fail marshl: %s", err.Error)
			}

			sbpExchange.SymbolChan <- string(out)
		}
	}
}

func spbExchangeInitSymbolPages() []map[string]string {
	state := make([]map[string]string, 5)

	state[0] = map[string]string{}
	state[0]["viewState"] = ""
	state[0]["eventValidation"] = ""

	state[1] = map[string]string{}
	state[1]["viewState"] = ""
	state[1]["eventValidation"] = ""

	state[2] = map[string]string{}
	state[2]["viewState"] = ""
	state[2]["eventValidation"] = ""

	state[3] = map[string]string{}
	state[3]["viewState"] = ""
	state[3]["eventValidation"] = ""

	state[4] = map[string]string{}
	state[4]["viewState"] = ""
	state[4]["eventValidation"] = ""

	return state
}

func spbExchangeLoadSymbol(page, viewState, eventValidation string) string {

	url := "https://spbexchange.ru/ru/stocks/inostrannye/Instruments.aspx"
	method := "POST"

	payload := &bytes.Buffer{}
	writer := multipart.NewWriter(payload)
	_ = writer.WriteField("ctl00$ScriptManager1", "ctl00$BXContent$iii$up|ctl00$BXContent$iii$pager$ctl01$ctl17")
	_ = writer.WriteField("bxValidationToken", "9fe49f6ee29b6a09e7d3bc7fa9b266ce")
	_ = writer.WriteField("ctl00$searchform1$searchform1$searchform1$query", "Поиск...")
	_ = writer.WriteField("ctl00$BXContent$iii$tbSearch", "")
	_ = writer.WriteField("ctl00$BXContent$iii$ddlCBView", "")
	_ = writer.WriteField("__EVENTTARGET", "ctl00$BXContent$iii$pager$ctl01$ctl"+page)
	_ = writer.WriteField("__EVENTARGUMENT", "")
	_ = writer.WriteField("__LASTFOCUS", "")
	_ = writer.WriteField("__VIEWSTATE", viewState)
	//""
	_ = writer.WriteField("__VIEWSTATEGENERATOR", "43734369")
	_ = writer.WriteField("__EVENTVALIDATION", eventValidation)
	//""
	_ = writer.WriteField("bitrix_include_areas", "N")
	_ = writer.WriteField("__ASYNCPOST", "true")

	err := writer.Close()
	if err != nil {
		fmt.Println(err)
	}

	client := &http.Client{}
	req, err := http.NewRequest(method, url, payload)

	if err != nil {
		fmt.Println(err)
	}
	req.Header.Add("Connection", "keep-alive")
	req.Header.Add("Pragma", "no-cache")
	req.Header.Add("Cache-Control", "no-cache")
	req.Header.Add("X-Requested-With", "XMLHttpRequest")
	req.Header.Add("X-MicrosoftAjax", "Delta=true")
	req.Header.Add("User-Agent", "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_15_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/83.0.4103.61 Safari/537.36")
	req.Header.Add("Content-Type", "application/x-www-form-urlencoded; charset=UTF-8")
	req.Header.Add("Accept", "*/*")
	req.Header.Add("Origin", "https://spbexchange.ru")
	req.Header.Add("Sec-Fetch-Site", "same-origin")
	req.Header.Add("Sec-Fetch-Mode", "cors")
	req.Header.Add("Sec-Fetch-Dest", "empty")
	req.Header.Add("Referer", "https://spbexchange.ru/ru/stocks/inostrannye/Instruments.aspx")
	req.Header.Add("Accept-Language", "ru-RU,ru;q=0.9,en-US;q=0.8,en;q=0.7")
	req.Header.Add("Cookie", "ASP.NET1_SessionId=s01jk5vc4pcfa5txrc5zwcxm; _ym_uid=15898826431072341284; _ym_d=1589882643; _ga=GA1.2.615606177.1589882643; i18next=ru; _ym_isad=2; _gid=GA1.2.1020189684.1591712492; BXBANNERS=36_151_200610; _ym_visorc_19028674=w")

	req.Header.Set("Content-Type", writer.FormDataContentType())
	resp, err := client.Do(req)
	defer resp.Body.Close()
	body, err := ioutil.ReadAll(resp.Body)

	if resp.StatusCode == http.StatusOK {
		return string(body)
	}

	return ""
}
